float toRadians(float degrees) {
	return degrees * PI / 180;
}

float toDegrees(float degrees) {
	return degrees * PI / 180;
}

float fmin(float a, float b) {
	if(a < b) {
		return a;
	} else {
		return b;
	}
}

float fmax(float a, float b) {
	if(a > b) {
		return a;
	} else {
		return b;
	}
}

float fabs(float a) {
	if(a < 0) {
		return -a;
	} else {
		return a;
	}
}

//Uses divide and conquer
float sqrt(float a) {
	uint8_t isLessThanOne = 0;
	float WITHIN_ERROR = 0.0001;											//If its close enough whatever just end the pain already
	
	if(a < 1) {
		a *= 0xFFFFF;
		isLessThanOne = 1;
		WITHIN_ERROR = 0.1;
	}
	//Bounds
	float lower = 0;
	float higher = a;
	float mid = a/2;
	
	while(mid-lower > WITHIN_ERROR || higher-mid > WITHIN_ERROR) {
		if(mid*mid > a) {
			higher = mid;
			mid = (higher + lower)/2;
		} else if (mid * mid < a) {
			lower = mid;
			mid = (higher + lower)/2;
		} else {
			return mid;
		}
	}

	if(isLessThanOne != 0) {
		mid /= 0x400;
	}
	
	return mid;
}

float sin(float angleInRadians) {
	int angleIsNegative = 1;
	if(angleInRadians < 0) {
		angleIsNegative = -1;
		angleInRadians *= -1;
	}
	
	float lookUpIndex = angleInRadians / 2 / PI;				//Convert the angle into a percentage of revolution
	lookUpIndex *= 16384;																//Convert percentage of revolution to percentage of table (index)
	lookUpIndex = ((int)lookUpIndex % 16384);						//Make sure index is in table			
	
	
	float out = ((float)(SIN_LOOKUP_TABLE[(int)lookUpIndex])-32768)/32768;
	out *= angleIsNegative;
	return out;
}

float cos(float angleInRadians) {
	return sin(angleInRadians + PI/2);
}

float tan(float angleInRadians) {
	return(sin(angleInRadians)/cos(angleInRadians));
}
